<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, user-scalable=no">
    <title>nuevo-nuevo</title>
    <link rel="stylesheet" href="../../../../node_modules/bootstrap/dist/css/bootstrap.min.css">
    <link rel="stylesheet" href="../../../../node_modules/font-awesome/css/font-awesome.min.css">
    <link rel="stylesheet" type="text/css" href="./posit.css">
  </head>
  <body>
    <div class="posit-Epass-Container">
      <div class="posit-Epass-Consulta-Oculta">
        <div class="bloques-ocultos bloque-oculto-izquierda"><i aria-hidden="true" class="fa fa-angle-left"></i></div>
        <div class="bloques-ocultos bloque-oculto-derecha"><i aria-hidden="true" class="fa fa-pencil-square-o"></i></div>
      </div>
      <div class="posit-Epass">
        <div class="posit-Epass-Consulta"> 
          <div class="posit-Epass-Titulo posit-Epass-titulo-Flecha"><i aria-hidden="true" class="fa fa-angle-right"></i></div>
          <div class="posit-Epass-MisSaldos">             
            <div class="posit-Epass-MisSaldos-Contenido"><span class="ePass-flecha"><i aria-hidden="true" class="fa fa-pencil-square-o"></i></span>
              <div class="ContenidoTextoScorcard">
                <div class="texto-scorecard">Nuevo</div>
                <div class="texto-scorecard">Scorecard</div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
    <script src="../../../../node_modules/jquery/dist/jquery.min.js"></script>
    <script src="../../../../node_modules/bootstrap/dist/js/bootstrap.min.js"></script>
    <script src="../../../../node_modules/jquery-validation/dist/jquery.validate.js"></script>
    <script src="./posit.js"></script>
  </body>
</html>
